<!DOCTYPE html>
<html>
<head>
<meta charset='utf-8'>
<style TYPE='text/css'>
body {
	background-color: #252525;
	color: #e8e8e8
}

.highlighter .add { 
	background-color: #1c7b50;
}

.highlighter .remove { 
	background-color: #80372b;
}

.highlighter td.modify { 
	background-color: #2c5075;
}

.highlighter td.conflict { 
	background-color: #c72c41;
}

.highlighter .spec { 
	background-color: #505050;
}

.highlighter .move { 
	background-color: #353535;
}

.highlighter .null { 
	color: #666;
}

.highlighter table { 
	border-collapse:collapse;
}

.highlighter td, .highlighter th {
	border: 1px solid #444;
	padding: 3px 7px 2px;
}

.highlighter th, .highlighter .header, .highlighter .meta {
	background-color: #636363;
	font-weight: bold;
	padding-bottom: 4px;
	padding-top: 5px;
	text-align:left;
}

.highlighter tr.header th {
	border-bottom: 2px solid black;
}

.highlighter tr.index td, .highlighter .index, .highlighter tr.header th.index {
	background-color: #4a4a4a;
	border: none;
}

.highlighter .gap {
	color: #666;
}

.highlighter td {
	empty-cells: show;
	white-space: pre-wrap;
}
</style>
</head>
<body>
<div class='highlighter'>
<table>
<thead>
<tr class="header"><th>@@</th><th>﻿key: int32</th><th>0: byte</th><th>1: str</th></tr>

<tr><td></td><td>43</td><td>0</td><td>DPS</td></tr>
<tr class="modify"><td class="modify">→</td><td>44</td><td class="modify">4→5</td><td>Role Quests</td></tr>
<tr class="modify"><td class="modify">→</td><td>45</td><td class="modify">5→6</td><td>Void Quests</td></tr>

<tr><td></td><td>48</td><td>5</td><td>Reaper</td></tr>
<tr class="modify"><td class="modify">→</td><td>49</td><td class="modify">6→7</td><td>Variant Dungeons</td></tr>
<tr class="modify"><td class="modify">→</td><td>50</td><td class="modify">7→8</td><td>Tales from the Calamity</td></tr>
<tr class="modify"><td class="modify">→</td><td>51</td><td class="modify">8→9</td><td>Tataru's Grand Endeavor</td></tr>

</tbody>
</table>
</div>
</body>
</html>
